import React from "react";
import styles from "./styles.module.css"; // Import your CSS styles

const HelloWorldComponent = ({ onClose }) => {
  return (
    <div className={styles.hello_world_container}>
      <h2>Hello, World!</h2>
      <button onClick={onClose} className={styles.close_btn}>
        Close
      </button>
    </div>
  );
};

export default HelloWorldComponent;
